import React from 'react';

const TabNavigation = ({ activeTab, setActiveTab, appraisalId }) => {
  const tabs = [
    { id: 'overview', label: 'Overview' },
    { id: 'market_analysis', label: 'Market Analysis' },
    { id: 'comparables', label: 'Comparables' },
    { id: 'comparable_analysis', label: 'Comparable Analysis' },
    { id: 'my_reports', label: 'My Reports' }
  ];

  return (
    <div className="flex gap-4 mb-6">
      {tabs.map((tab) => (
        <button
          key={tab.id}
          onClick={() => setActiveTab(tab.id)}
          className={`text-sm font-bold leading-normal tracking-[0.015em] px-2 py-1 ${
            activeTab === tab.id
              ? 'border-b-2 border-blue-500 text-blue-900'
              : 'text-[#58728d] hover:text-blue-700'
          }`}
        >
          {tab.label}
        </button>
      ))}
    </div>
  );
};

export default TabNavigation;
